- 1 cup quinoa
- 2 cups chicken broth
- 2 cups of Kale
- 1/4 of a red onion
- 1/2 cup of julienne sun dried tomatoes 
- chicken sausage of your choice

Dump the quinoa and chicken broth in a greased 9x13 baking dish and season with salt and pepper. I added garlic powder and red pepper flakes too. Then add your shredded kale and red onion. Lastly, cover the top in your chicken sausage and cover with aluminum foil and bake for 30 min at 375. Remove the cover after 30 min and bake about 20 more min or until quinoa is done. Easy way to get a healthy meal in! 
